import React from "react";

function CancelReservation({ selected, setTable }) {
  function action() {
    fetch("http://localhost:4000/cancelReservation" + selected)
      .then((res) => res.json())
      .then((data) => {
        setTable(data);
      });
  }
  return (
    <div className="p-10">
      <button onClick={action}>CANCEL RESERVATION</button>
    </div>
  );
}

export default CancelReservation;
